import React, {useState, useContext,useEffect} from 'react';
import { StatusBar } from 'expo-status-bar';

//icons
import {Ionicons} from '@expo/vector-icons'

import{StyledContainer,InnerContainer,PageLogo,PageTitle,SubTitle,StyledFormArea,StyledTextInput, StyledInputLabel, LeftIcon, RightIcon, StyledButton, ButtonText, Colors,MsgBox,Line,
        ExtraView,ExtraText,Textlink,TextLinkContent} from './../components/styles';

import {View,StyleSheet,Text,TouchableOpacity,Platform} from 'react-native';

import CredentialsContext from './../components/CredentialsContext';

//AsyncStorage
import AsyncStorage from '@react-native-async-storage/async-storage'

import { useNavigation } from '@react-navigation/native';

import axios from 'axios';

import { Table, Row, Rows } from 'react-native-table-component';

import Users from '../Modal/Users';

import KeyboardAvoidingWrapper from './../components/KeyboardAvoidingWrapper';

//PDF imports
import {printToFileAsync} from 'expo-print';
import {shareAsync} from 'expo-sharing';

const {tertiary, darklight,secondary, primary, grey}= Colors;

const User = () => {
const [hidePassword,setHidePassword] = useState(true);
const ip = 'http://192.168.1.187:8080/api';
const {storedCredentials, setStoredCredentials} = useContext(CredentialsContext);
const {name,lastName,role,email} = storedCredentials;
const [selectedUser,setSelectedUser] = useState('');
const [activeItems, setActiveItems] = useState([]);

//For the Modal
const [modalVisible,setModalVisible] = useState(false);

const navigation = useNavigation();

const [users,setUsers] = useState([]);

const BaseImg = 'data:image/png;base64,';


const clearLogin = () => {
    AsyncStorage.removeItem('inventoryManagementCredentials')
      .then(() => {
        setStoredCredentials("");
      })
      .catch((error) => console.log(error));
  };

  const getUsers = async () => {
    const url = ip+'/getUsers';
    try {
      const response = await axios.get(url);
      const resultArray = response.data;
      setUsers(resultArray);
    } catch (error) {
      console.error("Error fetching:", error);
    }
  }
//For the Modal to close
const openModal = () => {
    setModalVisible(true);
  };

  const closeModal = () => {
    setModalVisible(false);
  };

  useEffect(() => {
    const fetchData = async () => {
      try {
        await getUsers();
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);


  const tableHead = ['Nombre', 'Apellido', 'Rol'];
  const tableData = users.map((user) => [
    user.Nombre,
    user.ApePat,
    <TouchableOpacity
    onPress={() => {setSelectedUser(user.Correo); openModal()}} >
   <Text style={styles.textB}>{ user.Rol}</Text>
  </TouchableOpacity>
  ]);
  /*
  make the pdf so it can organize the items based on the locations theyre at.
  like a table with items per location
  */

  const generatePDFFromActiveItems = async () => {
    try {
      const url = `${ip}/pdfMaker/1`;
      const response = await axios.get(url);
      const activeItemsData = response.data;
  
      if (typeof activeItemsData === 'object' && Object.keys(activeItemsData).length > 0) {
        const activeItemsHTML = [];
  
              // Custom structure for title and logo
              activeItemsHTML.push(`
              <div style="display: flex; align-items: center;">
              <img src=${BaseImg}
              alt="Logo" style="width: 100px; height: 100px;" />
                <h1 style="margin-left: 20px;">C4 Playas de Rosarito Articulos Activos</h1>
              </div>
            `);

        for (const location in activeItemsData) {
          if (activeItemsData.hasOwnProperty(location)) {
            const items = activeItemsData[location];

  
            activeItemsHTML.push(`<h2>${location}</h2>`);
  
            let tableHTML = `<table border="1">
              <tr>
                <th class="upc-serial">UPC</th>
                <th class="upc-serial">Serial</th>
                <th>Nombre</th>
                <th>Modelo</th>
                <th>Descripcion</th>
                <th>Marca</th>
                <th>Municipio</th>
                <th class="resguardante">Resguardante</th>
              </tr>`;
  
            items.forEach((item) => {
              tableHTML += `<tr>
                <td class="upc-serial">${item.UPC}</td>
                <td class="upc-serial">${item.Serial}</td>
                <td>${item.Nombre}</td>
                <td>${item.Modelo}</td>
                <td>${item.Descripcion}</td>
                <td>${item.Marca}</td>
                <td>${item.Municipio}</td>
                <td class="resguardante">${item.Resguardante}</td>
              </tr>`;
            });
  
            tableHTML += `</table>`;
            activeItemsHTML.push(tableHTML);
          }
        }
  
        const fullHTMLContentActive = `
          <html>
            <head>
              <title>Articulos Activos</title>
              <style>
                @page {
                  size: landscape;
                }
                table {
                  border-collapse: collapse;
                  width: 100%;
                  table-layout: fixed;
                  columns: 2; /* Adjust the number of columns as needed */
                }
                th, td {
                  border: 1px solid black;
                  text-align: left;
                  padding: 8px;
                }
                th {
                  background-color: #f2f2f2;
                }
                .upc-serial {
                  width: 15%;
                }
                .resguardante {
                  width: 10%; 
                }
              </style>
            </head>
            <body>
              ${activeItemsHTML.join('\n')}
            </body>
          </html>`;
  
        const file = await printToFileAsync({
          html: fullHTMLContentActive,
          orientation: 'landscape', 
          base64: false
        });
        await shareAsync(file.uri);
      } else {
        console.log("No active items found.");
      }
    } catch (error) {
      console.error("Error fetching:", error);
    }
  };
  
  const generatePDFFromBajaItems = async () => {
    try {
      const url = `${ip}/pdfMaker/2`;
      const response = await axios.get(url);
      const activeItemsData = response.data;
  
      if (typeof activeItemsData === 'object' && Object.keys(activeItemsData).length > 0) {
        const activeItemsHTML = [];
  
              // Custom structure for title and logo
              activeItemsHTML.push(`
              <div style="display: flex; align-items: center;">
              <img src=${BaseImg}
              alt="Logo" style="width: 100px; height: 100px;" />
                <h1 style="margin-left: 20px;">C4 Playas de Rosarito Articulos Dados de Baja</h1>
              </div>
            `);

        for (const location in activeItemsData) {
          if (activeItemsData.hasOwnProperty(location)) {
            const items = activeItemsData[location];

  
            activeItemsHTML.push(`<h2>${location}</h2>`);
  
            let tableHTML = `<table border="1">
              <tr>
                <th class="upc-serial">UPC</th>
                <th class="upc-serial">Serial</th>
                <th>Nombre</th>
                <th>Modelo</th>
                <th>Descripcion</th>
                <th>Marca</th>
                <th>Municipio</th>
                <th class="resguardante">Resguardante</th>
              </tr>`;
  
              
            items.forEach((item) => {

              tableHTML += `<tr>
                <td class="upc-serial">${item.UPC}</td>
                <td class="upc-serial">${item.Serial}</td>
                <td>${item.Nombre}</td>
                <td>${item.Modelo}</td>
                <td>${item.Descripcion}</td>
                <td>${item.Marca}</td>
                <td>${item.Municipio}</td>
                <td class="resguardante">${item.Resguardante}</td>
                </tr>`;
            });
  
            tableHTML += `</table>`;
            activeItemsHTML.push(tableHTML);
          }
        }
  
        const fullHTMLContentActive = `
          <html>
            <head>
              <title>Articulos Activos</title>
              <style>
                @page {
                  size: landscape;
                }
                table {
                  border-collapse: collapse;
                  width: 100%;
                  table-layout: fixed;
                  columns: 2; /* Adjust the number of columns as needed */
                }
                th, td {
                  border: 1px solid black;
                  text-align: left;
                  padding: 8px;
                }
                th {
                  background-color: #f2f2f2;
                }
                .upc-serial {
                  width: 15%;
                }
                .resguardante {
                  width: 10%; 
                }
              </style>
            </head>
            <body>
              ${activeItemsHTML.join('\n')}
            </body>
          </html>`;
  
        const file = await printToFileAsync({
          html: fullHTMLContentActive,
          orientation: 'landscape', 
          base64: false
        });
        await shareAsync(file.uri);
      } else {
        console.log("No active items found.");
      }
    } catch (error) {
      console.error("Error fetching:", error);
    }
  };


    return(
      <KeyboardAvoidingWrapper>
        <StyledContainer>
            <StatusBar style="dark"/>
            <View style={styles.center}>
            <PageLogo resizeMode="cover" source={require('./../assets/images/C4Logo.png')}/>
                <PageTitle>{name} {lastName}</PageTitle>
                <SubTitle>{email}</SubTitle> 
                </View>

            {(role == 1) &&
                <View style={styles.innerContainer}>
      <Table borderStyle={{ borderWidth: 2, borderColor: tertiary}}>
        <Row data={tableHead} style={styles.head} textStyle={styles.headText} />
        <Rows data={tableData} textStyle={styles.text} />
      </Table>
                </View>}
                <Users isVisible={modalVisible} closeModal={closeModal} user={selectedUser}/>

                <View style={styles.center}>
                {(role == 1) &&
                <SubTitle>Generar PDF de los artículos:</SubTitle> }
                <StyledFormArea>
                {(role == 1) &&
                <StyledButton google={true} onPress={generatePDFFromActiveItems}>
                    <Ionicons name={'document'}size={30} color={primary}/>
                    <ButtonText>Activos</ButtonText>
                </StyledButton>}
                {(role == 1) &&
                <StyledButton google={true} onPress={generatePDFFromBajaItems}>
                    <Ionicons name={'document'}size={30} color={primary}/>
                    <ButtonText>Dados de Baja</ButtonText>
                </StyledButton>}
                <StyledButton logout={true} onPress={clearLogin}>
                <Ionicons name={'log-out'}size={30} color={primary}/>
                    <ButtonText>Logout</ButtonText>
                </StyledButton>
                </StyledFormArea>
                </View>
            

        </StyledContainer>
        </KeyboardAvoidingWrapper>
    );
}

const styles = StyleSheet.create({
    center: {
        width: "auto",
        alignItems: 'center',
      marginTop:10},
    innerContainer: {
        paddingHorizontal: 20,
        borderRadius: 5,
        marginTop: 5,
      },
      head: {
        height: 40, backgroundColor: secondary, 
      },
      headText: {
        margin: 6, fontWeight: 'bold', color: primary,fontSize: 16,paddingLeft:15
      },
      text: {
        fontSize: 16,
        marginVertical: 3,
        color: secondary,
        paddingLeft:10,
        padding: 15,

      },
      textB: {
        fontSize: 16,
        marginVertical: 3,
        color: tertiary,
        paddingLeft:10,
        padding: 15,
        fontWeight: 'bold'
      },
  });

export default User;